import "./app.scss"
import Home from "./pages/Home/Home";
import Login from "./pages/login/Login";
import Register from "./pages/register/Register";
import Watch from "./pages/Watch/Watch";

import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";


const App =()=> {
  return (
    <Router>
        <Switch>
           <Route exact path="/">
             <Home />
           </Route>
           <Route path="/movies">
             <Home type="movies" />
           </Route>
           <Route path="/series">
             <Home type="series"/>
           </Route>
           <Route path="/watch">
             <Watch />
           </Route>

         </Switch>
   </Router>
   )
}

export default App;
